// App.js
import React from 'react';
import UserSettingsProvider from './UserSettingsProvider';
import SettingsForm from './SettingsForm';
import DisplaySettings from './DisplaySettings';

const App = () => {
  return (
    <UserSettingsProvider>
      <div>
        <SettingsForm />
        <DisplaySettings />
      </div>
    </UserSettingsProvider>
  );
};

export default App;
